import styled from "styled-components";

export const ContentWrapper = styled.div`
    display: grid;
    grid-template-columns: 1fr;
    grid-template-rows: 4em 1fr;
`

export const HeaderWrapper = styled.div `
    grid-row: 1;
    grid-column: 1;
    margin: 0 auto;
`
